import React from "react";

class mainApp extends React.Component {
  render() {
    return (
      <main>
        <form>
          <label>
            <span>name</span>
            <input type="text" />
          </label>
        </form>
        <p>Hola Mundo</p>
      </main>
    );
  }
}

export default mainApp;
